Table_Page_1_Header_Top.query:
MasterHierarchy = load "Master_Hierarchy";
result_Total = group MasterHierarchy by all;
result_Total = foreach result_Total generate "$ values in millions" as '$ values in millions', "ACV" as 'ACV', "AOV" as 'AOV', "ATTRITION" as 'ATTRITION', "PipeGen" as 'Pipeline';

Filter_Lead.query:
q = load "APM_ACV";
q = group q by ('Lead');
q = foreach q generate case when 'Lead' == "Tony Owens" then "1. Tony Owens" when 'Lead' == "Brian Millham" then "2. Brian Millham" when 'Lead' == "Miguel Milano" then "3. Miguel Milano" when 'Lead' == "Mark Innes" then "4. Mark Innes" when 'Lead' == "Shinichi Koide" then "5. Shinichi Koide" when 'Lead' == "Dave Rey" then "6. Dave Rey" when 'Lead' == "Maria Martinez" then "7. Maria Martinez"else "9. unkown" end as Lead_Rank  ,'Lead' as 'Lead', count() as 'count';
q = order q by 'Lead_Rank' asc;
q = limit q 2000;

